import './Home.css';

import CardsCont from "../../components/CardsCont/CardsCont";
import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { getPokemons, filterPokemons, orderPokemons } from "../../redux/actions";


const Home = () => {
    const dispatch = useDispatch();

    const handleOrder = (event) => {
        dispatch(orderPokemons(event.target.value));
    }

    const handleOFilter = (event) => {
        dispatch(filterPokemons(event.target.value));
    }

    useEffect(() => {

        dispatch(getPokemons())

    }, []);



    return (
        <div className="homeCont">

            <h1> POKEMONS </h1>
            <div className="filtAndOrd">
                <select onChange={handleOrder}>
                    <option value="A">Asc</option>
                    <option value="D">Des</option>
